import type { Session } from './App';
import React, { useState } from 'react';

import { List, Tabs } from 'antd';
import { HeartOutlined } from '@ant-design/icons';
import CourseList from './CourseList';
import TimeProgress from './TimeProgress';

interface Props {
  sessions: Session[];
  courseDuration?: number; // minute
}

const CourseCard: React.FC<Props> = ({ sessions, courseDuration }) => {
  return (
    <div>
      {/* <CourseList sessions={sessions} /> */}
      <TimeProgress sessions={sessions} courseDuration={courseDuration} />
      <Card style={{ marginLeft: 12 }}>
          <CourseList title="Course Part 2" sessions={sessions} />
        </Card>
    </div>
  );
};

export default CourseCard;
